import React, { useState } from 'react';
import BlogEntry from '../components/BlogEntry/BlogEntry';
import './Blog.css';

export default function Blog()
{
    return(
        <div id = "blog-page-wrapper">
            <BlogEntry blog_link = "/blog/about" content = "We have an upcoming recital on DATE." title = "Upcoming recital" date = "August 5th, 2021" />
            <BlogEntry blog_link = "/blog/about" content = "Hello! This is the Music Unbounded blog! We will post updates here for our organization." title = "First Entry" date = "August 5th, 2021" />
        </div>
    )
}
